// dist/index.js
var Herald = class {
  constructor(injections) {
    const { react, minstrel, page } = injections;
    console.log("page", page);
    console.log("injections", injections);
    console.log("main", minstrel.getMain());
    if (page) {
      minstrel.setRoute({
        path: "/",
        element: react.lazy(page)
      });
    } else {
      throw new Error("Missing page");
    }
  }
  exec() {
    console.log("I'm proclaiming 235!");
    document.body.addEventListener("click", (event) => {
      console.log(event.target, "click");
    });
  }
  static inject() {
    console.log("inject!");
    return {
      "react": "react/react:16.13.1",
      "minstrel": "boardmeister/minstrel:latest",
      "subscribers": "!subscriber",
      page: "vizier/herald-page:1.0.0"
    };
  }
};
var dist_default = Herald;
export {
  dist_default as default
};
